import React from 'react';
import { Link } from 'react-router-dom';

const Footer = () => {
  return (
    <footer className="footer">
      <h3>Let's connect Digitally</h3>

      <Link to="#">
        <i class="social-icon fab fa-facebook-square fa-2x"></i>
      </Link>
      <Link to="#">
        <i class="social-icon fab fa-twitter-square fa-2x"></i>
      </Link>
      <Link to="#">
        <i class="social-icon fab fa-instagram-square fa-2x"></i>
      </Link>
      <Link to="#">
        <i class="social-icon fas fa-envelope-square fa-2x"></i>
      </Link>

      <p>&copy; copyright 2022 halfwayhome</p>
    </footer>
  );
};

export default Footer;
